import code

xx = code.Solution()

def tt(a,b):
    print(a)
    v = xx.longestPalindromeSubseq(a)
    print(v)
    #print(xx.ccc)
    assert(v==b)

xx.longestPalindromeSubseq('asdf')
print(xx.l_list_dict)
print(xx.r_list_dict)
for c in 'asdf':
    for i in range(4):
        assert('asdf'.find(c,i,4) == xx.l_list_dict[c][i])
        assert('asdf'.rfind(c,0,i) == xx.r_list_dict[c][i])

tt('asdf',1)
tt('bbbcb',4)
tt('asdfdsa',7)
xx.longestPalindromeSubseq("abaababaab")
tt("hiddqscdxr",3)
xx.longestPalindromeSubseq("")
tt("",159)
xx.longestPalindromeSubseq("")
